import React from "react";
import useSWR from "swr";
import Navbar from "./Navbar";

export default function Dashboard({ api }) {
  const fetcher = (url) => api.get(url).then((r) => r.data);
  const { data, error } = useSWR("/portfolio/list", fetcher);

  if (error) return <p className="text-center text-red-600">Error loading portfolio</p>;
  if (!data) return <p className="text-center text-gray-600">Loading...</p>;

  return (

    <div className="max-w-5xl mx-auto p-6">
      <h2 className="text-3xl font-bold mb-6">Your Portfolio</h2>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {data.map((p) => (
          <div
            key={p._id}
            className="bg-white p-6 rounded-xl shadow-md border border-gray-200"
          >
            <h3 className="text-xl font-bold">{p.title}</h3>
            <p className="text-gray-700 mt-2">{p.description}</p>

            {p.url && (
              <a
                href={p.url}
                target="_blank"
                rel="noreferrer"
                className="mt-4 inline-block bg-blue-600 text-white px-4 py-2 rounded-lg"
              >
                Visit
              </a>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}
